import cl from "./Input.module.css";
import Icon from "./icon.svg";

export const Input = ({
  type,
  size,


  disabled,
  startIcon,
  endIcon,
  placeholder,
  ...props
}) => {
  return (
    <label>

      <input
        className={[cl.input, cl[size], cl[type], cl[color]].join(
          " "
        )}
        disabled={disabled}
        placeholder={placeholder}
        {...props}></input>
    </label>
  );
};
